tables.table_schema:
CREATE TABLE quantum_gate_operations (
    gate_id INT PRIMARY KEY,
    gate_name VARCHAR(255) NOT NULL,
    gate_description TEXT
);
CREATE TABLE qubit_effects (
    effect_id INT PRIMARY KEY,
    gate_id INT,
    effect_description TEXT
);

CREATE TABLE quantum_gates (
    gate_id UUID PRIMARY KEY,
    gate_name STRING,
    operation STRING,
    effect_on_qubits STRING
);

CREATE TABLE qubits (
    qubit_id UUID PRIMARY KEY,
    qubit_name STRING,
    qubit_state STRING,
    gate_applied UUID REFERENCES quantum_gates(gate_id)
);

CREATE TABLE gate_history (
    history_id UUID PRIMARY KEY,
    gate_id UUID REFERENCES quantum_gates(gate_id),
    qubit_id UUID REFERENCES qubits(qubit_id),
    execution_time TIMESTAMP
);

CREATE TABLE quantum_gates (
    gate_id INT PRIMARY KEY,
    gate_name VARCHAR(50),
    gate_operation VARCHAR(50),
    gate_matrix TEXT
);

CREATE TABLE qubits (
    qubit_id INT PRIMARY KEY,
    qubit_name VARCHAR(50),
    qubit_value BOOLEAN,
    qubit_description TEXT
);

CREATE TABLE gate_effects (
    effect_id INT PRIMARY KEY,
    effect_name VARCHAR(50),
    effect_description TEXT
);

CREATE TABLE QuantumGates (
    gate_id UUID PRIMARY KEY,
    gate_name VARCHAR(50) NOT NULL,
    gate_matrix VARCHAR(255) NOT NULL
);

CREATE TABLE Qubits (
    qubit_id UUID PRIMARY KEY,
    qubit_state VARCHAR(10) NOT NULL
);

CREATE TABLE GateOperations (
    operation_id UUID PRIMARY KEY,
    gate_id UUID REFERENCES QuantumGates(gate_id),
    qubit_id UUID REFERENCES Qubits(qubit_id),
    operation_result VARCHAR(10) NOT NULL
);

CREATE TABLE Users (
    user_id UUID PRIMARY KEY,
    username VARCHAR(50) UNIQUE NOT NULL,
    email VARCHAR(50) UNIQUE NOT NULL
);

CREATE TABLE UserGateHistory (
    history_id UUID PRIMARY KEY,
    user_id UUID REFERENCES Users(user_id),
    operation_id UUID REFERENCES GateOperations(operation_id),
    timestamp TIMESTAMP NOT NULL
);
